er failed to get access to a resource. The most likely error they received was an access denied or error 5.</p>','2020-12-27 09:27:28','2020-12-27 09:27:28'),(98,151,25,'<p>Kerberos service tickets are obtained by a client and passed to a server to gain access to resources on that server. They\'re signed using a secret which only that server that has the resource being requested can decrypt. When the SPN is on the wrong account in Active Directory the secret that is used is the one of the accounts the SPN is on instead of the one of the servers.</p><p>As a result, the server can\'t decrypt the ticket and gives back an error to the client.</p>','2020-12-27 09:27:39','2020-12-27 09:27:39'),(99,151,25,'<h2>Resolution</h2><p>To resolve this issue, the service principal name must be searched for and removed from the alternative account and then it must be added to the correct account in Active Directory. To do that follow these steps:</p><ol><li><p>At an elevated command prompt and using Enterprise Administrator credentials, run the command <code>setspn -Q &lt;SPN&gt;</code>. This will return a computer name. SetSPN.exe is installed with the Active Directory Directory Services role or with RSAT.</p></li><li><p>Remove the incorrectly registered SPN by going to the command prompt and running the command <code>setspn -D &lt;SPN&gt; &lt;computername&gt;</code>.</p></li><li><p>Add the SPN to the correct account at the command prompt by running the command <code>setspn -A &lt;SPN&gt; &lt;computername of computer which had the System event 4&gt;</code>.</p></li></ol>','2020-12-27 09:27:52','2020-12-27 09:27:52'),(100,153,24,'<p>Test again the ticket history logs.</p>','2020-12-30 13:48:24','2020-12-30 13:48:24'),(101,152,25,'<p>dfgaegr</p>','2020-12-30 14:21:53','2020-12-30 14:21:53'),(102,156,25,'<p><img src=\"data:image/png;base64,\" alt=\"Screenshot 2020-09-25 at 15.38.41.png\"></p><p></p><p></p><p></p>','2021-01-03 10:28:04','2021-01-03 10:28:04'),(103,155,25,'<p>ofjiewfjow