henticate to.\n\nThis problem may appear in a network trace with an error response from the resource server showing the error KRB_AP_ERR_MODIFIED.\n\nIn this scenario, the remote server can\'t decrypt the ticket the client sent to it since the password used to encrypt it isn\'t the right one. That, in turn, is the result of the SPN for that service and ticket being on the incorrect object in AD. It is that other objects password that is used instead. In this scenario, the server who can\'t decrypt the ticket responds to the client. The client then puts Kerberos event 4 (example below) in its System event log. Less commonly this is caused by network problems between client and server where the ticket is truncated.','2020-12-27 09:28:34','2020-12-27 09:28:34'),(42,151,25,'KERBEROS Event ID 4\n\n    Event Type: Error\n    Event Source: Kerberos\n    Event Category: None\n    Event ID: 4\n    Date: 8/17/2004\n    Time: 1:30:00 PM\n    User: N/A\n    Computer: MACHINENAMEDescription:\n    The kerberos client received a KRB_AP_ERR_MODIFIED error from the server host/machinename.childdomain.rootdomain.com. The target name used was cifs/machinename.domain.com. This indicates that the password used to encrypt the kerberos service ticket is different than that on the target server. Commonly, this is due to identically named machine accounts in the target realm (childdomain.rootdomain.COM), and the client realm. Contact your system administrator.','2020-12-27 09:28:44','2020-12-27 09:28:44'),(43,152,25,'When you click Advanced in the Select Users, Computers, or Groups dialog box in Active Directory Users and Computers and then you try to add a trusted domain user to a trusting domain, you may receive the following error message:\n\n    The server is not operational.','2020-12-27 09:34:10','2020-12-27 09:34:10'),(44,152,25,'This behavior may occur if the guest account on the trusted domain is turned on. The guest account doesn\'t have the rights to enumerate users.','2020-12-27 09:34:19','2020-12-27 09:34:19'),(45,153,24,'testttt','2020-12-30 13:47:21','2020-12-30 13:47:21'),(46,156,25,'Slavica, can you please send them updated manual and point to section alarm plans','2021-01-02 15:17:46','2021-01-02 15:17:46'),(47,174,36,'client access - just adding internal note from client access','2021-01-05 08:18:56','2021-01-05 08:18:56'),(48,173,25,'Slavica, can you please test the emailing issue with Marcel over teamviewer','2021-01-06 12:23:03','2021-01-06 12:23:03'),(49,198,253,'Do not forget to close!','2021-02-10 19:34:39','2021-02-10 19:34:39'),(50,199,253,'<p>Test internal note <em><strong>with formatting</strong></em>!</p><p><img src=\"data:image/gif;base64,\" alt=\"ezgif-6-520b21add030.gif\"></p>','2021-02-20 20:07:54','2021-02-20 20:07:54'),(51,198,25,'<p><strong>RL</strong></p><p><strong>&nbsp;Rolf Lustenberger 02/03/2021:</strong></p><p>Guten Tag Herr Lustenberger</p><p>Habe den Fehler mit dem Chipnet gefunden.</p><p>Kabel von Flexbox zu Steckdose war i.O.</p><p>Kabel von Steckdose zu Netzwerkverteilung war i.O.</p><p>Kabel von Netzverteilung auf Switch war nicht korrekt gesteckt.</p><p>Kabel neu gesteckt und nun läufts.</p><p>Ich weiss, dass letzte Woche an den Switches etwas gemacht worden ist (Montage hatte längeren Ausfall).</p><p>Wahrscheinlich ist dies ein Folgefehler…</p><p>Nun ist das Chipnet auch über die IP 10.39.23.21 erreichbar:&nbsp;&nbsp;</p><p>Freundliche Grüsse</p><p>Patrick Jordi<br>Direktwahl +41 58 767 66 80<br><a href=\"mailto:Patrick.Jordi@vzug.com\" rel=\"noopener noreferrer nofollow\">Patrick.Jordi@vzug.com</a></p><p><strong>V-ZUG AG</strong></p><p>Industriestrasse 66, Postfach, 6302 Zug/Schweiz<br>Telefon +41 58 767 67 67</p><p><a href=\"mailto:info@vzug.com\" rel=\"noopener noreferrer nofollow\">info@vzug.com</a>,&nbsp;<a href=\"http://www.vzug.com/\" rel=\"noopener noreferrer nofollow\">www.vzug.com</a></p><p>Attachments</p><p><a href=\"https://panel.inax.help/storage/files/original/Mxoe-1C+/V-Zug%20Chipnet.jpg\" rel=\"noopener noreferrer nofollow\">V-Zug Chipnet.jpg</a></p><p>&nbsp;</p><p><strong>RL</strong></p><p><strong>&nbsp;Rolf Lustenberger 02/03/2021:</strong></p><p><strong>Rolf Lustenberger heute um 10:03 Uhr:</strong>&nbsp;Chipnet für BMA ist im Netzwerk nicht mehr erreichbar. Herr Jordi wird nun das Netzwerk überprüfen und dann Bescheid geben.</p><hr><br/><p>Sarka Cahakova</p><p>Isando Technologies LTD</p>','2021-03-04 17:14:09','2021-03-04 17:14:09');
