"EN-US\" style=\"color:black;mso-fareast-language:DE\">Alarmserver Management -<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"color:black;mso-fareast-language:DE\">Notfallpläne &amp;&nbsp; Security Specialists<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"color:black;mso-fareast-language:DE\"><o:p>&nbsp;</o:p></span></p>\r\n<p class=\"MsoNormal\"><b><span style=\"color:black;mso-fareast-language:DE\">Office Cham / Schweiz<o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\"><span style=\"color:black;mso-fareast-language:DE\">Riedstrasse 13, 6330 Cham<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"color:black;mso-fareast-language:DE\">phone&nbsp;&nbsp; +41 41 560 37 38<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"color:black;mso-fareast-language:DE\"><o:p>&nbsp;</o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"color:black;mso-fareast-language:DE\">Web:&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><span lang=\"DE\" style=\"color:black;mso-fareast-language:DE\"><a href=\"https://inax.ch/\"><span lang=\"EN-US\" style=\"color:#0563C1\">https://inax.ch</span></a></span><span lang=\"EN-US\" style=\"color:black;mso-fareast-language:DE\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"color:black;mso-fareast-language:DE\">Email:&nbsp;&nbsp;&nbsp; office@inax.ch<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"color:black;mso-fareast-language:DE\"><o:p>&nbsp;</o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-fareast-language:DE\">Diese E-Mail enthält vertrauliche und/oder rechtlich geschützte Informationen. Wenn Sie nicht der richtige Adressat sind oder diese Email irrtümlich erhalten haben, informieren Sie bitte sofort den\r\n Absender und vernichten Sie diese E-Mail. Das unerlaubte Kopieren sowie die unbefugte Weitergabe dieser E-Mail ist nicht gestattet.\r\n<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><o:p>&nbsp;