l\"><b><span style=\"mso-fareast-language:DE\">Von:</span></b><span style=\"mso-fareast-language:DE\"> Knapp Gernot &lt;gernot.knapp@ostertagdetewe.de&gt;\r\n<br>\r\n<b>Gesendet:</b> Montag, 25. Januar 2021 14:32<br>\r\n<b>An:</b> Office &lt;office@inax.ch&gt;<br>\r\n<b>Cc:</b> Haak Holger &lt;holger.haak@ostertagdetewe.de&gt;; Gaiser Christine &lt;christine.gaiser@ostertagdetewe.de&gt;; contact@inax247.com<br>\r\n<b>Betreff:</b> Anzahlungsrechnung &quot;Update Klinikum Schwerin&quot; Re-500111<o:p></o:p></span></p>\r\n</div>\r\n</div>\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n<p class=\"MsoNormal\">Hallo Frau&nbsp; Panovski,<o:p></o:p></p>\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n<p class=\"MsoNormal\">Wie soeben telefonisch besprochen benötigen wir die beigefügte Rechnung erneut mit der Bezeichnung Anzahlungsrechnung (bitte Rechnungsstorno und Neuberechnung), da der Begriff &#8222;Teilrechnung&#8220; auf eine Teilschlussrechnung mit Leistungserbringung\r\n hinweist, <o:p></o:p></p>\r\n<p class=\"MsoNormal\">wohingegen bei der Anzahlungsrechnung lediglich eine vertraglich vereinbarte Vorauszahlung angefordert wird<o:p></o:p></p>\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n<p class=\"MsoNormal\">Ich habe ihnen ebenfalls wie besprochen das Beispiel einer Schlussrechnung beigefügt, bei der Anzahlungsrechnungen berücksichtigt sind.<o:p></o:p></p>\r\n<p class=\"MsoNormal\">Wichtig ist, dass nicht der Rechnungsbetrag ( Projektwert) sondern lediglich der mit der Schlussrechnung angeforderte Zahlungsbetrag um die Anzahlungen reduziert wird.<o:p></o:p></p>\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n<p class=\"MsoNormal\">Beispiel: Bauleistung steht hier für den Rechnungsendbetrag( Projektwert) , verbleibende Restzahlung für den Zahlungsendbetrag<o:p></o:p></p>\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n<p class=\"MsoNormal\"><img width=\"541\" height=\"190\" style=\"width:5.6333in;height:1.9833in\" id=\"Grafik_x0020_1\" src=\"cid:image001.png@01D6F326.3F9ABA60\"><o:p></o:p></p>\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n<p class=\"MsoNormal\">Vielen Dank für Ihre Unterstützung<o:p></o:p></p>\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-language:DE\">Beste Grüße<o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-language:DE\">Gernot Knapp</span></b><span style=\"mso-fareast-language:DE\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-language:DE\">Teamleiter Kreditoren<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-language:DE\">Ostertag DeTeWe GmbH</span><span style=\"mso-fareast-language:DE\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-language:DE\">phone: +49 7127 9286 &#8211; 337<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-language:DE\">mobile: +49 1511 8029063</span><span style=\"mso-fareast-language:DE\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n</div>\r\n</body>\r\n</html>\r\n',NULL,NULL,'2021-01-25 13:54:02','2021-01-25 15:01:50','2021-01-25 15:01:50',NULL,NULL,NULL,NULL,NULL,0,1,NULL,1,NULL,NULL),(192,9,'App\\Company',9,'App\\Company',24,24,NULL,NULL,9,2,1,NULL,'WG: Offene Rechnungen Telepage','<html xmlns:v=\"urn:schemas-microsoft-com:vml\" xmlns:o=\"urn:schemas-microsoft-com:office:office\" xmlns:w=\"urn:schemas-microsoft-com:office:word\" xmlns:m=\"http://schem